    function logout(){
        setCurrentUser(null);
    }

    return(
        <div>
            <Menu attached="top" >
                <Dropdown.Menu>
                    <Dropdown.Item name="dropdown">
                        <NavLink to="/" exact className="button">
                            Raregifs
                        </NavLink>
                    </Dropdown.Item>
                </Dropdown.Menu>
            </Menu>
        </div>
    ); 
}

export default NavBar;


